  async fetch(request, env, ctx) {
    if (request.method !== 'POST') {
      return new Response("Method Not Allowed", { status: 405 });
    }
    let fakeEmailForm = await request.json()  
    let headers = new Headers();
    headers.set("subject", fakeEmailForm.subject);
    headers.set("from", fakeEmailForm.from);
    headers.set("to", fakeEmailForm.to);

    let fakeEmail = {
        from: fakeEmailForm.from,
        to: fakeEmailForm.to,
        headers: headers,
        forward: async function(destAddress){
            console.info("forward to %s", destAddress)
            return {success: true, rejectionReason: 'this is a simulation'}
        },
        setReject: function(msg){
            console.info("setReject: reason:", msg);
            return msg
        }
    };
    await this.email(fakeEmail, env, ctx);
    return new Response("OK", { status: 200 });
  }
}

